nt!\n\n-------------------------------------------\n\nAnd don't forget to SUBSCRIBE TO OUR CHANNEL - new videos are being added all the time! https://www.youtube.com/subscription_center?add_user=wondrium \n\n-------------------------------------------\n\nJOIN OUR COMMUNITY OF LIFELONG LEARNERS \n& BECOME A PART OF THE CONVERSATION: \n-YouTube: https://www.youtube.com/user/wondrium \n-Twitter: http://twitter.com/wondrium \n-Facebook: http://www.facebook.com/wondrium \n-Instagram: https://www.instagram.com/wondrium/ \n-LinkedIn: https://www.linkedin.com/company/the-great-courses-by-the-teaching-company\n-Blog: https://www.wondriumdaily.com/ \n\n-------------------------------------------\n\n#physics #theoryofrelativity #Einstein",
