        "publishedAt": "2022-05-23T20:06:24Z",
        "channelId": "UCTtEhdlWz5erVK734-Gn0VQ",
        "title": "World’s Longest Rail | Jesper Tjäder",
        "description": "Swedish freeskier Jesper Tjäder set his sights on breaking the Guinness World Record for the longest rail slide on skis, which was previously held by legendary freeskier Tom Wallisch. Now after six years and 127 attempts, Tjäder wrote freeskiing history by smashing Wallish’s record after completing a rail measuring 154,49 meters aka 506 feet and 28 inches.\n\nLet your favourite YouTube host@steepsteep  take you backstage as the Olympic Bronze medalist takes on the world's longest metal pipe in Åre, Sweden.\n\n“Being the official Guinness World Record holder feels pretty cool. I have dreamt about it since I was a kid. This rail was a hard challenge, and my guess was that it would take about 525 attemptsbut it went way easier than I expected.” says Jesper Tjäder.\n\nEarlier in May, work began in Stendalen in Åre, Sweden, to build and implement the world's longest rail. After the just over 162 meter (531 feet) long metal rail was in place, it took three days and 127 attempts until the new Guinness World Record was a fact, 154.49 meters or 506 feet 10.28 inches, on May 9th at 5:23pm CEST. Tjäder jumped on the rail at a speed of about 77 kilometers per hour (47.85 mph) and landed with the leading ski on the rail eight meters in.\n___\nExperience the world of Red Bull Snow like you have never seen it before. With the best snow action sports clips on YouTube and original series,  from skiing to snowboarding, prepare for your \"stoke factor\" to be at an all time high.\n\nSubscribe to Red Bull Snow on YouTube: https://win.gs/SubToRedBullSnow\n\nGet the FREE Red Bull TV apps for all your devices:  https://go.onelink.me/351027264/35a30660\n\nRed Bull Snow on Facebook: https://www.facebook.com/RedBullSnow/\n\nRed Bull Snow on Instagram: https://www.instagram.com/redbullsnow",
