        "title": "Snowboarding STEEP Double Black Runs in Telluride Colorado",
        "description": "Subscribe: https://bit.ly/subscribetoboardarchive\nFeatured Snowboard\nK2 Instrument: https://bit.ly/3phGAHm\n\nBoard Archive Merchandise\nhttps://bit.ly/BoardArchiveShop\n\nMy Snowboard Gear\nUnion Atlas: https://bit.ly/3rve5dp\nRide Fuse Boot: https://bit.ly/3I30aRi\nFavorite Midlayer: https://bit.ly/3HSwkiq\nAnon M4 Goggles: https://bit.ly/3cX1O92\nOyuki Tamashii Mitt: https://bit.ly/3p3Y1fH\n686 Mountain Mitt: https://bit.ly/310k6UA\nDope Iconic Pants: https://bit.ly/dopepants\n686 Anorak: https://bit.ly/3E4ZOY8\nVolcom Bibs: https://bit.ly/3p3Y5Mt\nVolcom Jacket: https://bit.ly/3E1t0zi\nBase Layers: https://bit.ly/3nYkA5Y\nHelmet: https://bit.ly/3EchCQY\n\n🎞 My Camera Gear 🎞\nhttps://www.amazon.com/shop/boardarchive\n\nAdd me\nhttp://www.instagram.com/boardarchive \n\nHad the chance to check out and explore Telluride recently! The terrain at the resort reminded me a lot of Jackson Hole and Revelstoke, very steep and technical in the conditions we had but loaded with natural features. This would be an amazing place to explore after a nice storm rolls through, we will have to come back! I just wanted to make this video to share the views and show you guys around a little bit while I was there. Thanks for watching.\n\n#snowboarding #telluride #boardarchive",
