        "title": "Ski Movie of the Year - Tales From Cascadia by BLANK Collective Films (2021)",
        "description": "Salomon in association with Rockstar present, IF3's Ski Movie of the Year - Tales From Cascadia by BLANK Collective Films\n\nFrom the Blank Collective comes a journey through a bioregion of volcanoes, watersheds and relentless coastal storms. This land is as diverse as its people, who hold a unifying identity of fun-seeking exploration. \nTales from Cascadia follows the adventures, misadventures and relentless heckling of the Blank crew; Stan Rey, Alexi Godbout, Anna Segal, Chris Rubens, Jordy Kidner, Josh Daiek, Lexi Dupont, Ian Morrison, ABM, Aaron Blunck and friends. Six tales that evoke a higher perspective, a road less traveled, a never-ending winter frozen in time. It was an amazing year to ski the home mountains, one where everyone chalked up a story or two... These are our tales from Cascadia.\n\nStarring: \n\nSupported by: Salomon, Rockstar Energy, gogglesoc, Forecast Ski Magazine, Stellar Equipment, Gibbons Après Lager, HEAD Freeskiing, FATMAP, Oyuki, K2 Skis, Eddie Bauer & Bolle. \n\nProduced by: Blank Collective Films\nDirected and Edited by: Jeff Thomas & Alexi Godbout\nPrincipal Cinematography: Scotty Titterington, Jeff Thomas, Hazen Woolson, Mitch Winton\nAudio Post Production: Ridgeline Sound\nMotion Design: Imperial Post\nGraphic Design: Gary Martin\n\nStarring:\n\nStan Rey / @stanrey \nAlexi Godbout / @alexigodbout_ \nAnna Segal / @anna_segal \nChris Rubens / @chrisrubens\nJosh Daiek / @joshdaiek \nAaron Blunck / @aaronblunck\nLexi Dupont / @lexidupont\nJordy Kidner / @jordykidner \nEric Hjorleifson / @hojboss\nCole Richardson / @skier_cole\nIan Morrison / @ian_morrison \nABM / @abmskier \nDrew Petersen / @drewpeterski \nLeah Evans / @eans_leah\nEmma Patterson / @taosenablonde\nGreg Hill / @_greghill_\n\nMusic provided by Music Bed, Audiio, Artist.io, Moontricks & Thomas Vent.\n\nFor live showing information visit: BLANKCollectivefilms.com",
