        "title": "Snowboarding the Infamous Tunnel Run - Alpe d'Huez - 4K",
        "description": "With all the resorts around the world closed down I originally thought I would be spending this period split boarding. But the government has issued strict guidelines urging people not to undertake any dangerous activities, which covers everything from surfing and cycling to skateboarding and surfing. Whilst this was a bitter pill to swallow at first,I now realize that it is so as not to put any additional strain on the health services. So here is some footage I shot a few weeks ago of the infamous Tunnel Piste here in Alpe d'Huez!\n\nThe Tunnel Run is one of the steepest pistes in Europe, so steep in fact that the top section cannot even be pisted as the piste bashers can't get up there! It gets its name from the 200m long tunnel which is actually carved through the mountain from one side to the other. This makes for a really cool and unique ski run that I haven't seen anywhere else.\n\nCheck out my new Snowboarding Outerwear here: https://bit.ly/3bu56Rc\n\n360 Camera - https://www.insta360.com/sal/one_x2?insrc=INRUQU3\nAction Camera - https://www.insta360.com/sal/one_r?insrc=INRUQU3\n\nTo support the channel - PayPal Tip Jar: https://www.paypal.com/paypalme/malcolmmoore0301\nOr Just go through this link next time you use Booking.com and I'll get 2% comission on your holiday cost instead of them!\nhttps://www.booking.com/index.html?aid=7943142\n\n\nIf you would like to have snowboard lessons with me here in Alpe d'Huez, France, then take a look at my website below to find out more:\n\nhttps://masterclasssnowboarding.com/\nhttps://www.instagram.com/malcolmmooresnowboarding/\n\nI'm Riding Amplid Boards, they good!\nhttp://amplid.com/?sPartner=MalcolmM\n\nIf you're in the UK or Europe, I recommend this shop for buying snowboarding equipment, it costs you nothing but helps me out!\n\nBlue Tomato - https://pn.blue-tomato.com/go.cgi?pid=119&wmid=cc&cpid=1&target=https://www.blue-tomato.com/en-GB/products/categories/Snowboard+Shop-00000000/%3Fcampa